import React from "react";
import { connect } from "react-redux";
import { getData } from '../action/index';

export class Post extends  React.Component {
    constructor(){
        super();
    }

    componentDidMount(){
        this.props.getData();
    }
    render(){
       {getData}
    }
}

export default connect(null,{getData})(Post);
